import React, { Component } from 'react'
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons'


export class Comp_3 extends Component {

     divStyle ={
        backgroundColor: 'navy',
        color: 'blue',
        textAlign: 'center'
    }

    render() {
        return (
            <div>
                <Parallax pages={3} scrolling={true} vertical ref={ref => (this.parallax = ref)}>
                    <ParallaxLayer style={{ divStyle}}offset={0} speed={0.5}>
                        <span  onClick={() => this.parallax.scrollTo(1)}>

                            <div >
                            SUP


                            </div>

                        </span>
                    </ParallaxLayer>
                </Parallax>

            </div>
        )
    }
}

export default Comp_3
